import './App.css';
import axios from "axios";
import React from "react";


class App extends React.Component{
    state = {detail: [], }

    componentDidMount() {
        let data;
        axios.get("http://127.0.0.1:8000/")
            .then(res => {
                data = res.data;
                this.setState({
                    detail: data
                });
            })
            .catch(err =>{
                console.log(err);
            })
    }
    render(){
        <div>
            <header>
                Данные из Django
            </header>
            <hr></hr>
            {this.state.detail.map((output, id) =>(
                <div key={id}>
                    <h2>{output.title}</h2>
                </div>
            ))}
        </div>
    }
}

export default App;
